import React, { Component } from 'react';

class Audio extends Component {
   render() {
      return (
         <main>
            <div className="jumbotron">
               <h1 className="ml-4">I finished my hearing exam</h1>
               <button type="button" className="btn btn-success">Finished</button>
             </div>
         </main>
      );
   }
}

export default Audio;
